import React from "react";
import d12 from "../components/assets/d12.jpeg";
// import d23 from "../components/assets/d23.jpeg";

const Section6 = () => {
  return (
    <div>
      <div
        style={{
          backgroundImage: `url(${d12})`,
          backgroundPosition: "center",
          backgroundSize: "cover",
          backgroundRepeat: "no-repeat",
          width: "100vw",
          height: "100vh",
          textAlign: "center",
        }}
      >
        <h1
          style={{
            paddingTop: "250px",
            textShadow: "0 0 0 #f0f8ff",
            fontFamily: "Open Sans",
            fontSize: "68px",
            fontWeight: "600",
          }}
        >
          Avokate: Anila Veizi
        </h1>
        <p style={{ fontSize: "24px", color: "black" }}> </p>
      </div>
    </div>
  );
};

export default Section6;
